import React, { useState } from 'react';

function App() {
  const [testResult, setTestResult] = useState<string>('');

  const testAPI = async () => {
    try {
      const response = await fetch('http://localhost:5001/api/health');
      const data = await response.json();
      setTestResult(JSON.stringify(data, null, 2));
    } catch (error) {
      setTestResult('Error: ' + error);
    }
  };

  const testRegister = async () => {
    try {
      const response = await fetch('http://localhost:5001/api/auth/register', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          email: 'test@example.com',
          password: '123456',
          name: '테스트사용자',
          role: 'employee',
          department: 'IT'
        })
      });
      const data = await response.json();
      setTestResult(JSON.stringify(data, null, 2));
    } catch (error) {
      setTestResult('Error: ' + error);
    }
  };

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif', maxWidth: '800px', margin: '0 auto' }}>
      <header style={{ backgroundColor: '#f5f5f5', padding: '20px', marginBottom: '20px', borderRadius: '8px' }}>
        <h1 style={{ color: '#333', margin: '0' }}>🏢 EAP Service - 근로자지원프로그램</h1>
        <p style={{ color: '#666', margin: '10px 0 0 0' }}>Employee Assistance Program Web Service</p>
      </header>

      <main>
        <div style={{ backgroundColor: '#e8f5e8', padding: '20px', borderRadius: '8px', marginBottom: '20px' }}>
          <h2>✅ 성공! 프론트엔드 실행 완료!</h2>
          <p>현재 페이지: <strong>http://localhost:3004</strong></p>
          <p>백엔드 API: <a href="http://localhost:5001/api/health" target="_blank" rel="noopener noreferrer">http://localhost:5001/api/health</a></p>
        </div>

        <div style={{ backgroundColor: '#fff3cd', padding: '20px', borderRadius: '8px', marginBottom: '20px' }}>
          <h2>🚀 완성된 EAP 시스템 기능</h2>
          <ul>
            <li>✅ 사용자 인증/권한 관리 (직원, 상담사, 관리자)</li>
            <li>✅ 온라인 상담 예약 시스템</li>
            <li>✅ 상담 기록 관리</li>
            <li>✅ 관리자 대시보드 (통계, 차트)</li>
            <li>✅ 리포트 생성 및 CSV 내보내기</li>
            <li>✅ 직장 갈등 해결 가이드</li>
            <li>✅ 모바일 반응형 디자인</li>
          </ul>
        </div>

        <div style={{ backgroundColor: '#d1ecf1', padding: '20px', borderRadius: '8px', marginBottom: '20px' }}>
          <h2>🧪 API 테스트</h2>
          <div style={{ marginBottom: '10px' }}>
            <button 
              onClick={testAPI}
              style={{
                backgroundColor: '#28a745',
                color: 'white',
                padding: '10px 20px',
                border: 'none',
                borderRadius: '5px',
                cursor: 'pointer',
                marginRight: '10px'
              }}
            >
              API 상태 확인
            </button>

            <button 
              onClick={testRegister}
              style={{
                backgroundColor: '#007bff',
                color: 'white',
                padding: '10px 20px',
                border: 'none',
                borderRadius: '5px',
                cursor: 'pointer'
              }}
            >
              사용자 등록 테스트
            </button>
          </div>

          {testResult && (
            <div style={{ 
              backgroundColor: '#f8f9fa', 
              padding: '15px', 
              borderRadius: '5px', 
              border: '1px solid #dee2e6',
              marginTop: '15px'
            }}>
              <h4>응답 결과:</h4>
              <pre style={{ margin: '0', fontSize: '14px' }}>{testResult}</pre>
            </div>
          )}
        </div>

        <div style={{ backgroundColor: '#f8d7da', padding: '20px', borderRadius: '8px' }}>
          <h2>📁 프로젝트 구조</h2>
          <pre style={{ backgroundColor: '#f8f9fa', padding: '15px', borderRadius: '5px', overflow: 'auto' }}>
{`eap-service/
├── backend/          ✅ Node.js API 서버 (실행중: :5001)
│   ├── models/      ✅ MongoDB 스키마
│   ├── routes/      ✅ API 엔드포인트
│   └── middleware/  ✅ 인증 & 권한
├── frontend/         ✅ React 앱 (실행중: :3004)
└── README.md         ✅ 상세 문서

🎯 MongoDB 설치하면 모든 기능 활성화!`}
          </pre>
        </div>
      </main>
    </div>
  );
}

export default App;
